import React from "react";
import {
  BarChart,
  Bar,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
} from "recharts";

const PriceRangeBarChart = ({ priceRanges }) => {
  if (!priceRanges || Object.keys(priceRanges).length === 0) {
    return <div>No data available</div>;
  }

  return (
    <div>
      <ul>
        {Object.entries(priceRanges || {}).map(([range, count]) => (
          <li key={range}>
            {range}: {count}
          </li>
        ))}
      </ul>

      <BarChart
        width={800}
        height={400}
        data={Object.entries(priceRanges).map(([range, count]) => ({
          range,
          count,
        }))}
        margin={{ top: 20, right: 30, left: 20, bottom: 5 }}
      >
        <CartesianGrid strokeDasharray="3 3" />
        <XAxis dataKey="range" />
        <YAxis />
        <Tooltip />
        <Legend />
        <Bar dataKey="count" fill="#8884d8" name="Count" />
      </BarChart>
    </div>
  );
};

export default PriceRangeBarChart;
